import * as React from 'react';
import { styled } from '../../stitches.config';
import { GamePlate } from '../../components';

const Game: React.FC = () => {
	return (
		<GamePlate>
			<Header />
			<Content />
		</GamePlate>
	);
};

export default Game;

const Header = styled('div', {
	width: 480,
	height: 128,
});

const Content = styled('div', {
	width: 480,
	height: 480,
	marginTop: 16,
});
